import React from 'react'


const UtilityBar = () => {
  return (
    <div className='utility-bar'>Sorting Algorithm Visualizer
      <button className='btn' onClick={this.props.generateArray}>Generate New Array</button>
      <button className='btn' >Quick Sort</button>
      <button className='btn' >Bubble Sort</button>
      <button className='btn' >Merge Sort</button>
      <button className='btn' >Heap Sort</button>
    </div>
  )
}

export default UtilityBar
